// Custom relu function
float relu(float x) {
    if (x > 0) {
        return x;
    } else {
        return 0;
    }
}

// Custom sigmoid function
float sigmoid(float x) {
    // Approximation of the exp function
    float exp_x = 1.0;
    float base = 2.718281828459045;  // e, base of the natural logarithm
    int n = 10;  // Number of terms in the Taylor series for approximation

    for (int i = 1; i <= n; i++) {
        float term = 1.0;
        for (int j = 1; j <= i; j++) {
            term *= x / j;
        }
        exp_x += term;
    }

    return 1 / (1 + 1 / exp_x);
}

float predict_occupancy(float temp, float humidity, float co2) {
    // Combine inputs
    float input[3] = {temp, humidity, co2};

    // Layer dense_15
    float dense_15_output[32] = {0};
    for (int i = 0; i < 32; i++) {
        for (int j = 0; j < 3; j++) {
            dense_15_output[i] += input[j] * dense_15_weights[j][i];
        }
        dense_15_output[i] += dense_15_biases[i];
        dense_15_output[i] = relu(dense_15_output[i]);
    }

    // Layer dense_16
    float dense_16_output[32] = {0};
    for (int i = 0; i < 32; i++) {
        for (int j = 0; j < 32; j++) {
            dense_16_output[i] += dense_15_output[j] * dense_16_weights[j][i];
        }
        dense_16_output[i] += dense_16_biases[i];
        dense_16_output[i] = relu(dense_16_output[i]);
    }

    // Layer dense_17 (final layer)
    float output = dense_17_biases[0];
    for (int i = 0; i < 32; i++) {
        output += dense_16_output[i] * dense_17_weights[i][0];
    }

    // Apply sigmoid activation function for binary classification
    output = sigmoid(output);

    return output;
}

// Utility function to print a number
void print_number(float number) {
    int integer_part = (int) number;
    float fractional_part = number - integer_part;

    // Print the integer part
    int divisor = 10000;
    while (divisor > 0) {
        int digit = integer_part / divisor;
        putchar('0' + digit);
        integer_part %= divisor;
        divisor /= 10;
    }

    putchar('.');

    // Print the fractional part
    for (int i = 0; i < 2; i++) {  // Two decimal places
        fractional_part *= 10;
        int digit = (int) fractional_part;
        putchar('0' + digit);
        fractional_part -= digit;
    }
}

int main() {
    for (int i = 0; i < Num_Data_Samples; i++) {
        float temp = Temp_Sensor_Input_Vector[i];
        float humidity = Humidity_Sensor_Input_Vector[i];
        float co2 = CO2_Sensor_Input_Vector[i];

        float occupancy_prediction = predict_occupancy(temp, humidity, co2);

        putchar('S'); putchar('a'); putchar('m'); putchar('p'); putchar('l'); putchar('e'); putchar(' ');
        print_number((float)i);
        putchar(' '); putchar('-'); putchar(' '); putchar('P'); putchar('r'); putchar('e'); putchar('d'); putchar('i'); putchar('c'); putchar('t'); putchar('e'); putchar('d'); putchar(' ');
        putchar('O'); putchar('c'); putchar('c'); putchar('u'); putchar('p'); putchar('a'); putchar('n'); putchar('c'); putchar('y'); putchar(':'); putchar(' ');
        print_number(occupancy_prediction);
        putchar('\n');
    }

    return 0;
}
